void findBinAndReduceVal( double * values, int* bins, double * reducedValues, int numel) {
	double* origin = (double *) &origins[0];
	for (int k=0; k<numel; k++ ) {
		using std::numeric_limits;
		using std::abs;
		double absval = abs( values[k] );
		float testval = (float) ( (absval < numeric_limits<double>::infinity())  ? absval : 0 );
		//bins[k] = binsearch<numPolynomes, int32_t *>( (int32_t * ) &tablelimits[0], *((int32_t *) &testval)); // requires volatile on testval and is slower (because of that?)
		bins[k] = binsearch<numPolynomes, float *>( (float * ) &tablelimits[0], testval );
		reducedValues[k] = (bins[k]>=cutoffbinidx ? 1/absval : absval) - origin[ bins[k] ];
	}
}

void evaluateTables( double * * outputptrs, int ntables , double * values, int nvalues, tempspace temp) {
	double * tableptrs[3] = {(double *) &fun1[0], (double *) &fun2[0],(double *)  &fun3[0]};
	double * table3extra = (double *) &fun3_extra[0];
	using std::min;
	using std::abs;
	using std::log;
	int numElBlk = min( nvalues, MAXELPERBLOCK) ;
	double * reducedval = temp.get<double>(numElBlk);
	int * bins = temp.get<int>(numElBlk);
	// loop over all blocks:
	for (int index =0 ; index<nvalues; ) {
		int ninblock = min( nvalues - index, MAXELPERBLOCK );
		// process first part: (lookup which polynome is required and reduce offset)
		findBinAndReduceVal( values+index, bins, reducedval , ninblock);

		// Evaluate polynomials:
		for (int curindexinblock=0; ninblock>0; --ninblock, ++index, ++curindexinblock) {
			int curtableidx = bins[curindexinblock] * polyorder;
			for (int table =0; table<ntables; table++ ) {
				double tempx = reducedval[curindexinblock];
				double * curtbl =  tableptrs[table] + curtableidx ;
				double tempval = curtbl[0];
				// evaluate polynomial, loop should be unrolled.
				for (int idx = 1; idx<polyorder ; idx++ ) {
					tempval *= tempx;
					tempval += curtbl[idx];
				}
				outputptrs[table][index] = tempval;
				//outputptrs[table][index] = tempx; // DEBUG ONLY

			}
			if (bins[curindexinblock]>=cutoffbinidx) {
				// To zero table we should add log(x) in the high part.
				outputptrs[0][index] -= .5* log( abs(values[index]) ) ;
			}
			if ((ntables>=2) && (values[index]<0) ) {
				outputptrs[1][index] = -outputptrs[1][index];
			}
			if (ntables>=3) {
				outputptrs[2][index] = outputptrs[2][index]*reducedval[curindexinblock] + table3extra[ bins[curindexinblock]*fun3_numextra ];
				if (values[index]<0) {
					outputptrs[2][index] = -outputptrs[2][index];
				}
				//outputptrs[2][index] =bins[curindexinblock]; // DEBUG ONLY
				/* DEBUG:
				if (index<=numPolynomes) {
					float * tmp = (float * ) &tablelimits[0];
					outputptrs[2][index] = tmp[index];
				}
				// */
			}
		}
	}

}


void mexFunction( int nlhs, mxArray *plhs[],
                  int nrhs, const mxArray *prhs[] )
{

	/* Check for proper number of arguments. */

	if ((nrhs!=1)) {
		mexErrMsgTxt("One input required: [out ] = rice_besseli_funs_c( bx ).");
	} else if ((nlhs<1)||(nlhs>3)) {
		mexErrMsgTxt("One, two, or three outputs required.");
	}
	const mxArray * in			= prhs[0]; // N-D array, single or double.
	
	/* parse inputs */
	//in:
	mwSize ndimsIn = mxGetNumberOfDimensions( in );

	const mwSize * sizeIn = mxGetDimensions( in );
	ptrdiff_t cumszIn=1;
	for(int k=0;k<ndimsIn;k++) {
		cumszIn *= sizeIn[ k];
	};
	if ((mxGetClassID(in)!=mxDOUBLE_CLASS) || mxIsComplex(in)){
		mexErrMsgTxt("Input should be non complex double. ");
	}
	double * inR = mxGetPr(prhs[0]);

	int tempspacebytesneeded =  MAXELPERBLOCK * (sizeof(double) + sizeof( int ) );
	const int maxthreadsuse =1;
	char * tempspaceptr =NULL;
    if (tempspacebytesneeded>0) {
        tempspaceptr = (char *) mxMalloc( tempspacebytesneeded * maxthreadsuse);
    }
	tempspace tmp = tempspace(tempspaceptr, tempspacebytesneeded);
        
	/* Create output. */
	double * outR[3];
	plhs[0] = mxCreateNumericArray((int) ndimsIn, sizeIn , mxDOUBLE_CLASS, mxREAL);
	outR[0] = mxGetPr(plhs[0]);
	if (nlhs>1) {
		plhs[1] = mxCreateNumericArray((int) ndimsIn, sizeIn , mxDOUBLE_CLASS , mxREAL);
		outR[1] = mxGetPr(plhs[1]);
		if (nlhs>2) {
			plhs[2] = mxCreateNumericArray((int) ndimsIn, sizeIn , mxDOUBLE_CLASS , mxREAL);
			outR[2] = mxGetPr(plhs[2]);
		}
	}

	evaluateTables( outR, nlhs , inR, cumszIn, tmp);
 
	if (tempspacebytesneeded>0) {
		mxFree(tempspaceptr);
	}
}
